      type: 'scatter',
      name: 'Infections'
  });
  traces.push({
      x: dates,
      y: totalDeaths,
      type: 'scatter',
      name: 'Deaths'
  });
  var layout = {
    title: 'Accumulated Coronavirus cases in Somalia (SO)',
    yaxis: {
       title: 'Accumulated number of cases'
    }
  };
  Plotly.newPlot('graph_accu_so', traces, layout, {
      displaylogo: false,
      modeBarButtonsToRemove: ['sendDataToCloud']
  });
</script>

    </div>
  </body>
</html>
